webpackJsonp([33133351926115],{7318:function(t,e){t.exports={data:{post:{html:'<p>Like <a href="http://fistfulofeuros.net/archives/001263.php">Tobias</a>, I wish that <a href="http://en.wikipedia.org/wiki/Godwin\'s_law">Godwin\'s Law</a> (that any discussion should be ended once anything is compared to Hitler or the Nazis) would be enforced more strictly in German politics, and in <a href="http://medienkritik.typepad.com/blog/2005/05/goebbels_would_.html">weblogs about Germany</a> as well. (Although strict enforcement in Great Britain would probably shut down the entire tabloid press... which may not be such a bad thing.)</p>',fields:{title:"The Conversation Has Just Ended",date:"04 May 2005",url:"https://papascott.de/2005-05-04-the-conversation-has-just-ended/"}}},pathContext:{slug:"/2005-05-04-the-conversation-has-just-ended/",prev:{fields:{title:"Bargaining with the Tooth Fairy",date:"03 May 2005",slug:"/2005-05-03-bargaining-with-the-tooth-fairy/"}},next:{fields:{title:"Did You Mean Mother's Day?",date:"05 May 2005",slug:"/2005-05-05-did-you-mean-mothers-day/"}}}}}});
